import React from 'react';
// import logo from './logo.svg';
import './App.css';


function Welcome() {
  return (
    <div>
      <h1>WELCOME TO THE MADNESS OF MARCH</h1>
      <h4>This is a website introducing you to all the teams for the College Basetball tournament this march</h4>
  </div>
  )
}

interface TeamInfo {
  tid: number;
  cid: number;
  born: number;
}

function App() {
  return (
    <div className="App">
      <Welcome/>
    </div>
  );
}

export default App;
